import React from 'react';
import HeaderWithSidebar from '../Sidebar';

function Wikipedia() {
  return(
    <div>
    <HeaderWithSidebar />
    <iframe src="https://www.wikipedia.org" width="100px" height="500px" style="border:none;"></iframe>
    </div>
  );
}

export default Wikipedia;
